import React, { useEffect, useState } from "react";
import Production from "./production";


export default function Test10(){

    const [productliste  , setproductliste]=useState([])
    
  const  product=()=>{
    fetch("https://fakestoreapi.com/products")
    .then((response) => response.json()) 
        .then((response)=>setproductliste(response)  )

    }
    useEffect(()=>{
        product()
      
    },[])                           
    
    const data=()=>{
       return productliste.map(   (preventstate,key) =>{
            console.log(preventstate )
           return <Production productdata={preventstate} key={key}/>

        })
    }

    return(
        <div className="container-fluid ms-auto w-75">
        <table className="table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Title</th>
              <th>Price</th>
              <th>Description</th>
              <th>Category</th>
              <th>Image</th>
              <th>Rating</th>
            </tr>
          </thead>
          <tbody>
       {data()}
          </tbody>
        </table>
        <Production/>
      
      </div>
    )
}
